import "./Child.css";

const Child = () => {
  return (
    <>
      <div className="component">
        <h3>Hello Component</h3>
      </div>
      <h3>Hello Fragment</h3>
      <p>
        Lorem ipsum, dolor sit amet consectetur adipisicing elit. Vitae veniam
        sit quam amet ut mollitia, accusantium quas, officia fuga fugit deserunt
        adipisci porro hic minus ea? Ad eaque harum vitae!
      </p>
    </>
  );
};

export default Child;
